import React, { createContext } from 'react'
export const DataContext = createContext({})
const withData = (Component) => props => {
  const { data } = props
  return (
    <DataContext.Provider value={data}>
      <Component {...props} />
    </DataContext.Provider>
  )
}

export default withData
